import { Link } from "react-router-dom";

const Card = ({ data }) => {
  return (
    <div className="recipe-preview" key={data._id}>
      <Link to={`/recipes/${data._id}`}></Link>
      <h2>{data.dish}</h2>
    </div>
  );
};

export default Card;
